  \"partial-pressure-or-fugacity-of-carbon-dioxide-dissolved-inorganic-carbon-ph-alkalinity-temperaa344b\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0109920 includes discrete
  sample and profile data collected from MELVILLE in the South Pacific Ocean and Tasman
  Sea from 2009-11-21 to 2010-02-11 and retrieved during cruise CLIVAR_P06_2009. These
  data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
  (CFC-12), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC
  CARBON (DIC), DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE,
  NEON, NITRATE, NITRITE, Potential temperature (theta), SALINITY, SULFUR HEXAFLUORIDE
  (SF6), TOTAL ALKALINITY (TA), Tritium (Hydrogen isotope), WATER TEMPERATURE, pH,
  phosphate and silicate. The instruments used to collect these data include Alkalinity
  titrator, CTD, Coulometer for DIC measurement, bottle and spectrophotometer.nnThese
  data were collected by Robert M. Key of Princeton University; Department of Geosciences;
  Program in Atmospheric and Ocean Sciences, Frank J. Millero of Rosenstiel School
  of Marine and Atmospheric Science, Rik Wanninkhof of US DOC; NOAA; OAR; Atlantic
  Oceanographic and Meteorological Laboratory and Craig A. Carlson of University of
  California - Santa Barbara as part of the CLIVAR_P06_2009 data set.nnThe International
  CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries out a systematic
  and global re-occupation of select WOCE/JGOFS hydrographic sections to quantify
  changes in storage and transport of heat, fresh water, carbon dioxide (CO2), and
  related parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
